START TRANSACTION;

DELETE FROM Budget;

ALTER TABLE Budget AUTO_INCREMENT = 1;

DROP TEMPORARY TABLE IF EXISTS denormalized;
CREATE TEMPORARY TABLE denormalized (
      Id                            int            NOT NULL AUTO_INCREMENT PRIMARY KEY
    , BudgetId                      int            NULL
    , Name                          varchar(50)    NOT NULL
    , Amount                        decimal(15,2)  NOT NULL
    , Type                          varchar(50)    NOT NULL
    , BudgetGroup                   varchar(50)    NOT NULL
    , BudgetCycle                   date           NOT NULL
    , DueDate                       int            NULL
    , IsPaidByCreditCardNotAccount  boolean        NULL
    , DateCreated                   datetime       NULL
    , DateModified                  datetime       NULL
);


SELECT * FROM denormalized ORDER BY Id DESC;

      Name
    , Amount
    , TypeId
    , BudgetGroupId
    , BudgetCycleId
    , DueDate
    , IsPaidByCreditCardNotAccount
    , ColorId
    , date_created
    , date_modified
)
SELECT
      denormalized.Name
    , denormalized.Amount
    , Type.TypeId
    , BudgetGroup.BudgetGroupId
    , BudgetCycle.BudgetCycleId
    , denormalized.DueDate
    , denormalized.IsPaidByCreditCardNotAccount
    , Color.ColorId
    , COALESCE(denormalized.DateCreated, '1970-01-01')
    , COALESCE(denormalized.DateModified, '1970-01-01')
FROM denormalized
LEFT OUTER JOIN Type
    ON Type.Name = denormalized.Type
    AND Type.ResourceType = 'B'
LEFT OUTER JOIN BudgetGroup
    ON BudgetGroup.Name = denormalized.BudgetGroup
LEFT OUTER JOIN BudgetCycle
    ON BudgetCycle.BudgetCycle = denormalized.BudgetCycle
LEFT OUTER JOIN Color
    ON Color.Value = NULL /* denormalized.Color */
LEFT OUTER JOIN vwBudget
    ON vwBudget.Name = denormalized.Name
    AND vwBudget.Amount = denormalized.Amount
    AND vwBudget.Type = Type.Name
    AND vwBudget.BudgetGroup = BudgetGroup.Name
    AND vwBudget.BudgetCycle = BudgetCycle.BudgetCycle
    AND (vwBudget.DueDate = denormalized.DueDate OR (vwBudget.DueDate IS NULL AND denormalized.DueDate IS NULL))
    AND (vwBudget.IsPaidByCreditCardNotAccount = denormalized.IsPaidByCreditCardNotAccount OR (vwBudget.IsPaidByCreditCardNotAccount IS NULL AND denormalized.IsPaidByCreditCardNotAccount IS NULL))
    AND (vwBudget.Color = Color.Value OR (vwBudget.Color IS NULL AND Color.Value IS NULL))
#WHERE vwBudget.BudgetId IS NULL
ORDER BY denormalized.Id;

SELECT * FROM vwBudget ORDER BY 1 DESC;

ROLLBACK;